import React from 'react';
import { useNavigate } from 'react-router-dom';
//import background from './assets/sudokuBackground.jpg'; // Opdater stien til, hvor du gemte billedet

function MenuScreen() {
  let navigate = useNavigate();

  const handleStartGame = () => {
    if (selectedDifficulty) {
      // Naviger brugeren til SudokuView komponenten med valgt sværhedsgrad
      navigate(`/sudoku/${selectedDifficulty}`);
    } else {
      alert('Vælg venligst en sværhedsgrad.');
    }
  };  
  const [selectedDifficulty, setSelectedDifficulty] = useState(null);


  const handleDifficultySelect = (difficulty) => {
    setSelectedDifficulty(difficulty);
  };

  return (
    <div>
      <h1>Velkommen til Sudoku!</h1>
      <p>Vælg en sværhedsgrad:</p>
      <button onClick={() => handleDifficultySelect('let')}>Let</button>
      <button onClick={() => handleDifficultySelect('medium')}>Medium</button>
      <button onClick={() => handleDifficultySelect('svær')}>Svær</button>
      <button onClick={handleStartGame}>Start Spil</button>
    </div>
  );
}


export default MenuScreen;
